const SecondSibling = (props) => {

    const [counter,setCounter] = useState(0);
  

  useEffect(() => {
    if (props.counter % 5 === 0) {
      
        setCounter(counter+1)
    }
  }, [props.counter]);

  return (
    <div>
        <h1>hello</h1>
      <h1>{counter}</h1>
    </div>
  );
};

export default SecondSibling;
